import React, { Component } from 'react'
import { Link } from 'react-router-dom';

export default class Header extends Component {
    render() {
        const navStyle = {
            color: '#5fcf80',
            display: 'contents',
            justifyContent: 'center'
        };
        return (
            <header id="header" className="fixed-top" >
                <div className="container d-flex align-items-center">
                    <a href="/" className="logo mr-auto"><img src={require("../img/logo/logo2.png")} alt="" className="img-fluid" /></a>
                    <h1 className="logo mr-auto"><a href="/">Uncorked</a></h1>

                    <nav className="nav-menu d-none d-lg-block">
                        <ul>
                            <Link to='/' style={navStyle}><li>Let's Start</li></Link>
                            <Link to='/stories' style={navStyle}><li>Stories</li></Link>
                            <Link to='/' style={navStyle}><li>Events</li></Link>
                            <Link to='/' style={navStyle}><li>Guests</li></Link>
                            <Link to='/' style={navStyle}><li>Blogs</li></Link>
                            <Link to='/' style={navStyle}><li>Behind the Curtains</li></Link>
                        </ul>
                    </nav>
                    <button type="button" className="get-started-btn" data-toggle="modal" data-target="#getStarted">
                        Get Started
            </button>

                </div>
            </header>
        )
    }
}
